import { createSlice, createAsyncThunk } from "@reduxjs/toolkit"

export const getData = createAsyncThunk(
    "product",
    async () => {
        return await fetch("data.json").then(
            (res)=>res.json()
        )
    }
)

const dataSlice = createSlice({
    name: "data",
    initialState: {
        data: [],
        status:null
    },
    
})
